css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("allmusic.com") {
* {font-family:segoe ui, sans-serif !important}
#review a.more, #large-list, #large-list a, #left-sidebar-list a:hover, .formed-sub a:hover, .large-list-title {color:#23276C !important;}
a:hover, #large-list a:hover {text-decoration:underline !important;}
.PagingRow, #bio a, #review a, .artist-key, #corrections #death .death-box, #email .email-box, #corrections #birth .birth-box, #name .name-box, #corrections #bio .bio-box, #discography .discography-box, #similar .similar-box, #corrections #source .source-box {background-color:#eee !important}
.PagingRow:hover, .BG-text a:hover, #bio a:hover, #review a:hover, .artist-key:hover, #corrections #death .death-box:hover, #email .email-box:hover, #corrections #birth .birth-box:hover, #name .name-box:hover, #corrections #bio .bio-box:hover, #discography .discography-box:hover, #similar .similar-box:hover, #corrections #source .source-box:hover, tr.visible:hover {background-color:#ccc !important}
#header_bottom, #header_menu, .titlebar2, #sendto, .amg_logo, #rovi_footer_logo, td.empty, .right-sidebar-background > div, div#site_menu > div.content_header, .shadowbar, .shadowbar_c, .picture-browser, #dhtmlbanner, div#middle_ad, div#right_column {display:none !important}
.titlebar, .expextra {background:#6D7C8D none !important} 
#bio {width:574px !important}
.right-sidebar-background, #right-sidebar, #right-sidebar .content {background:#fff !important}
.tabsbg, .tab_on, .tab__on, .tab_on_, .tab_off, .tab__off, .tab_off_, .tab_on_off, .tab_on_on, .tab_off_on, .tab_off_off, .tab_null, .tab__null, .tab_null_, .tab_off_null, .tab_on_null, .tab_null_off, .tab_null_on, .tab_null_null {background:none !important}
.tab td {font-size:120% !important;}
#start {width:24px !important}
div#header_body {background:none !important; padding-top:0 !important}
#head_top {height:auto !important}
td.titlebar .title {position:inherit !important}
td {height:auto !important}
td.content-cell > table > tbody > tr > td.titlebar {padding-top:10px !important; padding-bottom:10px !important;}
div#site_menu {height:114px !important}
#artistminibio, #bio {text-align:justify !important}
#large-list li, span.libg, #left-sidebar-list li {background-image:none !important}
#large-list a {text-decoration:none !important}
#large-list ul {margin:0 !important}
span.libg {padding-left:0 !important}
div#header_body > div {height:auto !important}
.clearer, #tabs {clear:none !important}
#search {margin:18px 6px 10px !important; padding:0 !important; background:none !important; border:0 !important; width:auto !important; height:auto !important; }
#search p {display:inline !important}
#search_opt {width:auto !important; padding-top:3px !important}
#adv_search_button {height:0 !important; width:0 !important; padding:10px !important; border:0 !important; background:#c5cbd1 !important; position:relative; top:1px;}
#adv_search_button:hover {background:#504B81 !important;}
#rovi_footer {background-color:#6D7C8D !important;}
div#header_logo a img, div#header_logo img, div#header_logo br {display:none !important}
div#header_logo a:first-child img {display:block !important; height:0 !important; width:0 !important; padding-left:220px !important; padding-top:47px !important; background: url("data:image/png;base64,%3D") no-repeat !important;}
}
